[{'comment_id': 916328079, 'comment_body': 'These versions should match, correct? Can you introduce a variable to hold it to make it less likely to get out of sync? See e.g. jetty.version defined in the parent pom.xml', 'comment_created': datetime.datetime(2022, 7, 7, 22, 34, 49, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916328977, 'comment_body': "There's no need to hold this as a static in Videobridge, is there?", 'comment_created': datetime.datetime(2022, 7, 7, 22, 36, 54, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916329937, 'comment_body': 'Should we drop the "current" prefix since the totals already have a "_total" suffix?', 'comment_created': datetime.datetime(2022, 7, 7, 22, 39, 28, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916332592, 'comment_body': 'I think this needs a @Override annotation', 'comment_created': datetime.datetime(2022, 7, 7, 22, 46, 18, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916334255, 'comment_body': 'Returning an `Object` is strange. Should this be parametrized instead? e.g. `Metric<T>` and `T getMetricValue()`', 'comment_created': datetime.datetime(2022, 7, 7, 22, 50, 17, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916335636, 'comment_body': "Is there a case where this returns anything different than `newValue`? I think I suggested this, but I didn't think it through -- a normal `void set(double newValue)` (still synchronized to prevent it racing with `addAndGet`) should be sufficient.", 'comment_created': datetime.datetime(2022, 7, 7, 22, 53, 52, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916335983, 'comment_body': 'nit: Maybe rename to just `CounterMetric` since there are no other kinds of counters.', 'comment_created': datetime.datetime(2022, 7, 7, 22, 54, 48, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916336293, 'comment_body': 'nit: How about just `get()`?', 'comment_created': datetime.datetime(2022, 7, 7, 22, 55, 31, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916336536, 'comment_body': 'nit: Rename to just `addAndGet`?', 'comment_created': datetime.datetime(2022, 7, 7, 22, 56, 4, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916336708, 'comment_body': 'Same as above', 'comment_created': datetime.datetime(2022, 7, 7, 22, 56, 30, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916338464, 'comment_body': '`GaugeMetric` would be the class to use when you want a `double` gauge, right? Maybe the methods should be public instead of protected.', 'comment_created': datetime.datetime(2022, 7, 7, 23, 1, 14, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916339678, 'comment_body': 'Idea: maybe this class is superfluus and these methods should go to the default (double) `GaugeMetric` class.', 'comment_created': datetime.datetime(2022, 7, 7, 23, 4, 11, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916340755, 'comment_body': "As you see we don't always care about the return value. Maybe expose additional `decrement` or `dec` methods (and `increment`/`inc`)?", 'comment_created': datetime.datetime(2022, 7, 7, 23, 6, 53, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916342803, 'comment_body': "Did you mean to return the existing metric if a metric with that name was already registered? Or just return `null` as a failure indication?

I suggest logging a warning or even throwing an exception, because I don't anticipate this happening legitimately.

The same applies to the other `register` methods.", 'comment_created': datetime.datetime(2022, 7, 7, 23, 11, 56, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916345538, 'comment_body': 'I think it would be nice to have an optional initial value, so we can have this start off as `true`.', 'comment_created': datetime.datetime(2022, 7, 7, 23, 19, 16, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916762905, 'comment_body': "I believe they should match, I'll add a version variable.", 'comment_created': datetime.datetime(2022, 7, 8, 12, 20, 25, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916767125, 'comment_body': 'No need, just an oversight!', 'comment_created': datetime.datetime(2022, 7, 8, 12, 26, 15, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916773395, 'comment_body': 'I think we should, that matches the metric name for the current number of conferences: `"conferences"`.
Should the _variable_ name keep the prefix? For `"conferences"` I named the variable `currentConferences` to avoid ambiguity with the Conference class.', 'comment_created': datetime.datetime(2022, 7, 8, 12, 34, 38, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916796420, 'comment_body': "It crossed my mind; I agree with `Metric<T>`.
 I would no longer extend `GaugeMetric` for both `BooleanMetric` and `LongGaugeMetric`.
I would have to implement them concretely, since we'd have `GaugeMetric implements Metric<Double>`.
I could perhaps make `GaugeMetric` a `DoubleGaugeMetric`? Those would be used for metrics such as bitrate.

Does it make sense to skip the getters (such as `getLong()`) and just use the `Metric<T>` interface method? (less clutter)
```java
public final class LongGaugeMetric implements Metric<Long>
{
    private final Gauge gauge;
    // ...

    @Override
    public Long getMetricValue()
    {
        return (long) gauge.get();
    }
    // ...
}
```

Other operations _could_ also return the parameterized type, such as `Long incrementAndGet()`.
The only issue I see here is returning boxed types but I don't believe that's a problem.", 'comment_created': datetime.datetime(2022, 7, 8, 13, 4, 29, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916798543, 'comment_body': "Sounds good, I wasn't sure if we'd have an unlikely double counter.", 'comment_created': datetime.datetime(2022, 7, 8, 13, 7, 11, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916800961, 'comment_body': '`void` is the way to go, I got carried away reading the concurrent.atomic javadocs and mixed it up with [getAndSet](https://docs.oracle.com/javase/8/docs/api/java/util/concurrent/atomic/AtomicInteger.html#getAndSet-int-).', 'comment_created': datetime.datetime(2022, 7, 8, 13, 10, 8, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916804542, 'comment_body': "Agreed, for simplicity's sake I only mimicked the previous `AtomicLong` behavior", 'comment_created': datetime.datetime(2022, 7, 8, 13, 14, 24, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916818060, 'comment_body': 'I think it makes sense to keep the variable name (we can change that at any point without affecting users).', 'comment_created': datetime.datetime(2022, 7, 8, 13, 29, 46, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916825305, 'comment_body': '"Other operations could also return the parameterized type, such as Long incrementAndGet()."

I like that. You could implement LongGaugeMetric and BooleanGaugeMetric by delegating to a DoubleGaugeMetric, but I'm not sure it's worth the effort (compared to re-implementing the few methods they have).', 'comment_created': datetime.datetime(2022, 7, 8, 13, 37, 51, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 916843806, 'comment_body': "I wasn't sure whether I should throw an exception or return an existing one so I left it as it is for now.
I believe the test failures are due to this.
As an example: in [ConferenceTest.kt](https://github.com/jitsi/jitsi-videobridge/blob/master/jvb/src/test/kotlin/org/jitsi/videobridge/ConferenceTest.kt#L31), initializing new `Videobridge.Statistics()` results in null metrics. This leads to `NullPointerException` when calling methods such as `totalConferencesCreated.incrementAndGetLong()`.

Should we just return the metric if it exists (and perhaps log a warning)?", 'comment_created': datetime.datetime(2022, 7, 8, 13, 57, 30, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916844724, 'comment_body': 'Agreed!', 'comment_created': datetime.datetime(2022, 7, 8, 13, 58, 26, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 916858365, 'comment_body': "Hm, that's an interesting problem. Returning the metric if it exists is not always possible because the type might be different. We can stop instantiating `Videobridge.Statistics` more than once, but that's not great. 

I don't really like how MC is static and leaves state behind between test runs. We could introduce a different MC implementation for tests, and have it cleaned up between tests. Is there a way to unregister metrics from Prometheus? I have to think about this some more.", 'comment_created': datetime.datetime(2022, 7, 8, 14, 12, 52, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 919058124, 'comment_body': 'Is a `null` value supported? If not, you can make `value` non-nullable, save it as a `val` and then return it here instead of having to use `!!`', 'comment_created': datetime.datetime(2022, 7, 12, 14, 41, 10, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 919060627, 'comment_body': 'nit: You can use the kotlin `mutableMapOf()` here', 'comment_created': datetime.datetime(2022, 7, 12, 14, 43, 17, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 919066159, 'comment_body': 'You can use `metrics.mapValues { it.value.get() }` here', 'comment_created': datetime.datetime(2022, 7, 12, 14, 47, 56, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 919979123, 'comment_body': "`null` values are not supported, I'll include the change", 'comment_created': datetime.datetime(2022, 7, 13, 11, 43, 12, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}, {'comment_id': 928958637, 'comment_body': 'Can it just inherit this from `jicoco-metrics`?', 'comment_created': datetime.datetime(2022, 7, 25, 14, 34, 30, tzinfo=datetime.timezone.utc), 'commenter': 'bgrozev', 'type': 'User'}, {'comment_id': 928991584, 'comment_body': 'The `/metrics` endpoint uses media type constants such as `TextFormat.CONTENT_TYPE_004`.
Only `simpleclient_common` is needed for that, but we can have those constants in `MetricsContainer` or write them ourselves in the endpoint (if you want both dependencies gone).', 'comment_created': datetime.datetime(2022, 7, 25, 15, 3, 41, tzinfo=datetime.timezone.utc), 'commenter': 'alexcsf', 'type': 'User'}]
